    protected override async Task OnInitializedAsync()
    {

        ListOfPackages = await cloudPackagesService.GetAllPackagesAsync();
        SearchedPackages = null;
    }
    private void Buy(int id)
    {
        _navigationManager.NavigateTo($"BuyingPackage/{id}");
